CREATE TABLE `blog_comment` (
  `comment_id` bigint NOT NULL COMMENT '评论id',
  `child_id` bigint NOT NULL DEFAULT '0' COMMENT '多级评论',
  `article_id` bigint NOT NULL DEFAULT '0' COMMENT '被评论的博客id',
